import React, { useState, useEffect } from "react";
import { Switch, Route, Link } from "react-router-dom";

import Home from "../../Home";
import { Colors, media } from "../../../assets/common/Styles";
import Profile from "../../Profile";
import StickyBox from "react-sticky-box";
import { Flex, styled } from "reakit";
import HiddenMenu from "../HiddenMenu";
import LoginForm from "../../LoginForm";
import { reduxForm } from "redux-form";

import { isValid as isFormValid, submit as submitForm } from "redux-form";
import { connect } from "react-redux";

const WrapperContent = styled(StickyBox)`
  height: 500px;
  position: fixed;
  z-index: 1;
  top: 0;
  left: 0;
  background-color: #fffefe;
  overflow-x: hidden;
  transition: 0.5s;
  padding-top: 60px;
  width: 100%;
`;

const MainPage = (props) => {
  return (
    <nav className="Nav">
      <div className="Nav__container">
        <Link to="/" className="Nav__brand">
          <img src="logo.svg" className="Nav__logo" />
        </Link>

        <div className="Nav__right">
          <ul className="Nav__item-wrapper">
            <li className="Nav__item">
              <Link className="Nav__link" to="/path1">
                Link 1
              </Link>
            </li>
            <li className="Nav__item">
              <Link className="Nav__link" to="/path2">
                Link 2
              </Link>
            </li>
            <li className="Nav__item">
              <Link className="Nav__link" to="/path3">
                Link 3
              </Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default connect((store) => null, {
  submitForm,
})(
  reduxForm({
    // a unique name for the form
    form: "mainForm",
  })(MainPage)
);
